import React,{Component} from 'react';
import {Card,Image,Icon} from 'semantic-ui-react';

class showDetails extends Component{

	constructor(props){
		super(props);
	}

	render(){
		console.log(this.props)
		for(let i=0;i<this.props.showCount+1;i++){
			return(
				<Card>
					<Image />
					<Card.Content>
						<Card.Header> {this.props.shows[i].showName} </Card.Header>
						<Card.Meta> {`${this.props.shows[i].date} $From : ${this.props.shows[i].fromTime} To : ${this.props.shows[i].toTime}`}</Card.Meta>
					</Card.Content>
					<Card.Content extra>
						<a>
							<Icon name='ethereum'/>
							{this.props.shows[i].amount} ether
						</a>
					</Card.Content>
				</Card>
			)
		}
	}
}

export default showDetails;
